import React from 'react';
import { Button } from "@material-ui/core";
import HeaderForms from './HeaderForms';
import TelaDois from './TelaDois';

function TelaUm() {
    return (
        <div>
            <HeaderForms />
            <form action={TelaDois}>
                <label for="nome" class="labelText">Full Name *</label>
                <input type="text" id="nome" class="inputText" required placeholder="Foo Bar"/>
                <label for="nickname" class="labelText">Nickname</label>
                <input type="text" id="nickname" class="inputText" placeholder="Juanito"/> 
                <Button type ="submit" variant="contained" color="primary" fullWidth>
                    Next
                </Button>
            </form>
        </div>
    );
}

export default TelaUm;
